    }

    :host([toggle="true"]) .top-app-bar-content-container {
      height: 3.5rem;
      opacity: 1;
    }

    :host([toggle="false"]) {
      opacity: 0;
    }

    :host([toggle="false"]) .top-app-bar-content-container {
      height: 0;
      opacity: 0;
    }

    .top-app-bar-content-container {
      display: flex;
      justify-content: space-between;
      align-items: center;
      position: relative;
      transition: height 0.2s ease-in-out, opacity 0.2s ease-in-out;
      height: 3.5rem;
      opacity: 1;
      background-size: 100% 100%;
      &::after {
        height: 100%;
        width: 3rem;
        content: '';
        opacity: 0;
      }
    }

