      display: flex;
      padding: 0.75rem 0 0.75rem 1rem;
      align-items: center;
      .top-app-bar-toggle {
        display: flex;
        cursor: pointer;
        :hover {
          border-radius: 0.5rem;
          background: rgba(255, 255, 255, 0.14);
        }
      }
    }

    .top-app-bar-toggle-container .top-app-bar-toggle svg {
      height: 1.25rem;
      width: 1.25rem;
      fill: rgba(255, 255, 255, 0.85);
      padding: 0.375rem;
    }

    .top-app-bar-apps {
      display: flex;
      height: 100%;
      justify-content: center;
      align-items: center;
      &:has(.divider-active) {
        gap: 0.375rem;
      }
      .top-app-bar-app-tiles {
        display: flex;
        height: 100%;
        gap: 0.375rem;
        .top-app-bar-app-tile {
          display: flex;
          user-select: none;
          -webkit-user-select: none;
          &.draggable-tile {
            user-drag: element;
