            justify-content: center;
            align-items: center;
            line-height: 130%;
            text-align: center;
            &::after {
              content: '';
              position: absolute;
              bottom: 0.25rem;
              width: 1rem;
              height: 0.125rem;
              background-color: rgba(255, 255, 255, 1);
              border-radius: 0.125rem;
              transition: opacity 0.2s ease-in;
              opacity: 0;
            }
          }
